import React from 'react';
import '../css/App.css';
import RouterHeader from '../components/RouterHeader'

export default function header() {
    return (
        <header className="header">
            <div className="container">
                <h1 style={{margin: '0'}}>Movie App</h1>
                <RouterHeader />
            </div>
        </header>
    )
}
